import Layout from '../components/Layout';

const random = () => {
  return (
    <Layout>
      <div>
        <div className="input--container">
          <input
            type="text"
            className="input"
            placeholder="Your color"
            maxLength={6}
            required
          />
          <span className="hashtag">#</span>
          {/* <span className></span> */}
        </div>
      </div>
    </Layout>
  );
};

export default random;
